window.bookSummaryJSON = "<p><b>Some doors aren't meant to be opened....</b></p> <p>While many on Earth grow fearful of the Messengers' remarkable powers and others lament a lack of interplanetary cooperation, two discoveries threaten to turn the world on its head.</p> <p>One find could simultaneously rewrite the history of two planets; one revelation could tear Dan McCarthy's life apart.</p> <p>With the stakes higher than ever following the birth of his daughter Piper - a child like no other with a secret the world isn't ready to handle - Dan will do whatever it takes to protect his family.</p> <p>But as keen as Dan is to help the Messengers at every turn, he might soon come to see that no good deed goes unpunished....</p>"; 
